import NavBar from "./NavBar";
import {
    APIProvider,
    Map,
    AdvancedMarker,
    Pin,
    InfoWindow
} from "@vis.gl/react-google-maps";

const libraries = ['places'];
const mapContainerStyle = {
    width: "500px",
    height: "500px"
};


export default function Dashboard(){
    const center = {
        lat: 16.255168643233784,
        long: 80.32518364053286
    };
    const {isLoaded, loadError} = useLoadScript({
        googleMapsApiKey: "AIzaSyAqHW3QmMMYPOP6uR5MMFvQQoIB3OkdhnE",
        libraries: libraries
    })
    return(
        <>
            <NavBar/>
            <div id="content">
                <h1>Live Location:</h1>

                <div id="map">
                    <GoogleMap mapContainerStyle={mapContainerStyle} zoom={14} center={center}>
                        <Marker position={center} />
                    </GoogleMap>
                </div>

            </div>
        </>
    )
}
